//Import CSS
import './AccountDropDown.css';

const AccountDropDown = () => {
    return (
        <div className='dropdown_container'>
            Hello, stranger!<br /><br />
            Sign In<br /><br />
            Create an Account!
        </div>
    );
}

export default AccountDropDown;
